import React from 'react';
import '../container/assignmentQna.css';
import UploadForm from './UploadForm';
import FilesList from './FilesList';

const AssignmentQNA = ({ userRole }) => {
  return (
    <div className='qna'>
      <h1>Assignment Section</h1>
      <div className='qna_div'>
        {userRole === 'moderator' ? (
          <>
            <div className='get_question'>
              <p>Uploaded Questions</p>
              <FilesList type="questions" />
            </div>
            <div className='upload_section'>
              <p>Upload Question File</p>
              <UploadForm type="question" />
            </div>
            <div className='get_answers'>
              <p>Submitted Answers</p>
              <FilesList type="answers" />
            </div>
          </>
        ) : (
          <>
            <div className='get_question'>
              <p>View Assignment Questions</p>
              <FilesList type="questions" />
            </div>
            <div className='upload_section'>
              <p>Submit Your Answer</p>
              <UploadForm type="answer" />
            </div>
          </>
        )}
      </div>
    </div>
  );
};

export default AssignmentQNA;
